/**
 * Configurations used for building core library files.
 */
module.exports = {
  extends: './.babelrc.js',
  ignore: ['/__snapshots__/', /^.*(.test.)[j|t]sx?$/]
};

/**
 * General configuration.
 */
module.exports = {
  presets: [
    '@babel/preset-typescript',
    ['@babel/preset-env', { modules: false }],
    ['@babel/preset-react', { runtime: 'automatic' }]
  ],
  plugins: [
    '@babel/plugin-proposal-object-rest-spread',
    '@babel/plugin-proposal-class-properties'
  ],
  env: {
    cjs: {
      presets: ['@babel/preset-env', '@babel/preset-react']
    },
    test: {
      presets: ['@babel/preset-env', '@babel/preset-react']
    }
  }
};

{
  "root": true,
  "parser": "@typescript-eslint/parser",
  "extends": [
    "plugin:react/recommended",
    "plugin:react-hooks/recommended",
    "prettier"
  ],
  "plugins": ["prettier", "react", "react-hooks", "@typescript-eslint"],
  "env": {
    "browser": true,
    "commonjs": true,
    "es6": true,
    "node": true,
    "jest": true
  },
  "settings": {
    "react": {
      "version": "detect"
    }
  },
  "globals": {
    "expect": true
  },
  "parserOptions": {
    "ecmaVersion": 6,
    "sourceType": "module",
    "ecmaFeatures": {
      "jsx": true,
      "generators": true,
      "experimentalObjectRestSpread": true
    }
  },
  "rules": {
    "react/jsx-uses-react": "off",
    "react/react-in-jsx-scope": "off",
    "react/prop-types": "off",
    "prettier/prettier": ["error"],
    "quotes": ["error", "single", { "allowTemplateLiterals": true }],
    "no-unused-vars": "off",
    "@typescript-eslint/no-unused-vars": ["error"]
  },
  "overrides": [
    {
      "files": ["*.ts", "*.tsx"],
      "rules": {
        "react/prop-types": "off"
      }
    }
  ]
}

/**
 * We generally use `nps` for scripts that we:
 * 1. define at the root of the monorepo
 * 2. that are meant to execute _within_ a workspace
 *
 * ... or ...
 *
 * - That could use a little JS magic that we don't want to write a full
 *   node script for ðŸ˜‚
 *
 * For more cases, if you have an actual root task, define it in root
 * `package.json:scripts`.
 */

module.exports = {
  scripts: {
    // Build
    // - Typescript
    'types:check': 'tsc --noEmit',

    // - tsup
    'tsup:watch': 'tsup --watch',
    tsup: 'tsup',

    // - Webpack
    webpack: 'webpack',

    // Test
    jest: 'jest',

    // Quality.
    // - Format
    'prettier:base': 'prettier --list-different',
    'prettier:base:fix': 'prettier --write',
    'prettier:pkg':
      'nps prettier:base -- -- --config ../../.prettierrc --ignore-path ../../.prettierignore',
    'prettier:pkg:fix':
      'nps prettier:base:fix -- -- --config ../../.prettierrc --ignore-path ../../.prettierignore',
    'prettier:website':
      'nps prettier:base -- -- --config ../.prettierrc --ignore-path ../.prettierignore',
    'prettier:website:fix':
      'nps prettier:base:fix -- -- --config ../.prettierrc --ignore-path ../.prettierignore',

    // - Lint
    'lint:base': 'eslint --cache --color',
    'lint:pkg': 'nps lint:base -- -- src',
    'lint:pkg:fix': 'nps lint:base -- -- --fix src'
  }
};

{
  "compilerOptions": {
    /* Language and Environment */
    "target": "ES6",                                  /* Set the JavaScript language version for emitted JavaScript and include compatible library declarations. */
    "lib": [
      "DOM",
      "ES2019"
    ],                                                /* Specify a set of bundled library declaration files that describe the target runtime environment. */
    "jsx": "react-jsx",                               /* Specify what JSX code is generated. */

    /* Modules */
    "module": "commonjs",                             /* Specify what module code is generated. */
    "moduleResolution": "node",                       /* Specify how TypeScript looks up a file from a given module specifier. */
    "allowUmdGlobalAccess": true,                     /* Allow accessing UMD globals from modules. */

    /* Interop Constraints */
    "allowSyntheticDefaultImports": true,             /* Allow 'import x from y' when a module doesn't have a default export. */
    "esModuleInterop": true,                          /* Emit additional JavaScript to ease support for importing CommonJS modules. This enables `allowSyntheticDefaultImports` for type compatibility. */
    "forceConsistentCasingInFileNames": true,         /* Ensure that casing is correct in imports. */

    /* Type Checking */
    "strict": true,                                   /* Enable all strict type-checking options. */
    "skipLibCheck": true                              /* Skip type checking all .d.ts files. */
  }
}

const path = require('path');
const webpack = require('webpack');

/**
 * Production library config.
 *
 * Used as a base, this produces with other configs:
 *
 * - `dist/spectacle.min.js`: production library
 * - `dist/spectacle.js`: development library
 */

module.exports = {
  mode: 'production',
  entry: './src/index.ts',
  output: {
    library: 'Spectacle',
    libraryTarget: 'umd',
    path: path.join(__dirname, 'dist'),
    filename: 'spectacle.min.js'
  },
  devtool: 'source-map',
  externals: {
    react: 'React',
    'react-dom': 'ReactDOM',
    'react-is': 'ReactIs'
  },
  resolve: {
    extensions: ['.tsx', '.ts', '.jsx', '.js'],
    modules: [path.join(__dirname, 'src'), 'node_modules']
  },
  module: {
    rules: [
      {
        test: /\.[tj]sx?$/,
        use: {
          loader: 'babel-loader',
          // eslint-disable-next-line global-require
          options: require('./.babelrc.js')
        }
      },
      { test: /\.(png|svg|jpg|gif)$/, use: ['file-loader'] }
    ]
  },
  plugins: [
    new webpack.ProvidePlugin({
      process: 'process/browser'
    })
  ]
};
